import React from 'react';
import SkillCard from './SkillCard';

const SkillCard1 = () => {
    return (
        <div className=' w-[35rem] bg-[#ffff] h-[30rem] mr-[6rem] justify-center overflow-y-scroll scroll-smooth mt-[2.5rem] '>
                <div className='grid grid-cols-2 gap-1'>
                <SkillCard/>   
                <SkillCard/>   
                <SkillCard/>   
                <SkillCard/>   
                </div>
        </div>
    );
}

export default SkillCard1;
